import React from 'react';
import { useNav } from '../customHooks/useNav';
import './Page.css';
import ReactTooltip from "react-tooltip";

const Tool = () => {
	// useNav takes in a navLinkId and returns a ref
	// this ref is used to register the navLinkId that's
	// currently in view, and apply activeClass styling
	// to the corresponding nav childElement

	const toolRef = useNav('Tool');

	return (
		<section ref={toolRef} id='toolContainer'>
			<img
				src='https://source.unsplash.com/random/600x600/?food,protein'
				alt='unsplash-img'
			/>
			<div>
				<h3>Use the search tool to help you make smart decisions on selecting food protein.</h3>
				<div>
					<h4 class="title">Good Sources of Protein Examples</h4>
					<ul class="examples">
						<li>milk</li>
						<li>fish</li>
						<li>cheese</li>
					</ul>
					<h4>Start Your Search</h4>
					<input type="text" placeholder='Type here...'/>
					<br></br>
					<button data-tip data-for="searchTip">Search</button>
					<ReactTooltip id="searchTip" place="bottom" effect="solid">
						Click here to get more infomation about this protein
					</ReactTooltip>
				</div>
			</div>
		</section>
	);
};

export default Tool;
